		String bshPath = "C:\\exportxls-mapdata.bsh";
		Connection con = DBUtil.openConnection("oracle.jdbc.driver.OracleDriver",
				"jdbc:oracle:thin:@localhost:1521:ORCL", "HIGTEST", "yinbin");
